/** @jsxRuntime classic */
/** @jsx jsx */
import { useState } from "react";
import { jsx, Styled } from "theme-ui";

export default function Button(props) {
  const backgroundColor = props.theme["background"];

  return (
    <Styled.a>
      <Styled.div
        sx={{
          cursor: "pointer",
          m: 0,
          backgroundColor: backgroundColor,
          p: 2,
          borderRadius: 16,
        }}
      >
        <Styled.h5>{props.data}</Styled.h5>
      </Styled.div>
    </Styled.a>
  );
}
